import React, {useState} from 'react';
import ArtCard from '../../components/ArtCard/ArtCard';

function SOffice() {
    const [sOffice] = useState({
        products: [
        {p_id: "6251", p_c_id: "ARTY", p_name: "Cienkopis PILOT V5", p_code: "ARTY62510", p_description: "kolor: czarny", p_price: 5.69},
        {p_id: "2267", p_c_id: "ARTY", p_name: "Długopis TOMA 059/050", p_code: "ARTY22670", p_description: "Kolor niebieski", p_price: 1.21},
        {p_id: "9571", p_c_id: "ARTY", p_name: "Dłukopis zwykły", p_code: "ARTY95710", p_description: "kolor: czarny", p_price: 0.41},
        {p_id: "9571", p_c_id: "ARTY", p_name: "Długopis zwykły", p_code: "ARTY95711", p_description: "kolor: niebieski", p_price: 0.41},
        {p_id: "1940", p_c_id: "ARTY", p_name: "Długopis automatyczny", p_code: "ARTY19400", p_description: "kolor: czerwony", p_price: 0.49},
        {p_id: "1319", p_c_id: "ARTY", p_name: "Flamaster", p_code: "ARTY13190", p_description: "kolor: czarny", p_price: 1.06}
        ]
    });

    let showCards;

    showCards = (
        <div>
            {sOffice.products.map((sOfficeR, index) => {
                return(
                    <ArtCard
                        imagename={sOfficeR.p_code}
                        name={sOfficeR.p_name}
                        description={sOfficeR.p_description}
                        price={sOfficeR.price}
                        key = {sOffice.index}
                    />
                )
                //console.log(sOffice.products[0]);
            })}
        </div>
    );

    return(
        <div>
            <h1>SHOP - OFFICE ARTICLES</h1>
            {showCards}
        </div>
    )
}

export default SOffice;
